(45,'privacy_policy','<p><strong>This Privacy Policy describes how your personal<br />\r\ninformation is collected, used, and shared when you<br />\r\nvisit or make a purchase from rchive.ca (the &ldquo;Site&rdquo;).</strong></p>\r\n\r\n<h3>PERSONAL INFORMATION WE COLLECT</h3>\r\n\r\n<p>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device. Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site and information about how you interact with the Site. We refer to this automatically-collected information as &ldquo;Device Information.&rdquo;</p>\r\n\r\n<p>We collect Device Information using the following technologies:</p>\r\n\r\n<p>&ldquo;Cookies&rdquo; are data files that are placed on your device or computer and often include an anonymous unique identifier. For more information about cookies, and how to disable cookies,</p>\r\n\r\n<p>Additionally, when you make a purchase or attempt to make a purchase through the Site, we collect certain information from you, including your name, billing address, shipping address, payment information, email address, and phone number. We refer to this information as &ldquo;Order Information.&rdquo;</p>\r\n\r\n<p>When we talk about &ldquo;Personal Information&rdquo; in this Privacy Policy, we are talking both about Device Information and Order Information.</p>\r\n\r\n<h3>HOW DO WE USE YOUR PERSONAL INFORMATION?</h3>\r\n\r\n<p>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations). Additionally, we use this Order Information to:</p>\r\n\r\n<p>Communicate with you;</p>\r\n\r\n<p>Screen our orders for potential risk or fraud; and</p>\r\n\r\n<p>When in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.</p>\r\n\r\n<p>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site (for example, by generating analytics about how our customers browse and interact with the Site, and to assess the success of our marketing and advertising campaigns).</p>\r\n\r\n<h3>SHARING YOUR PERSONAL INFORMATION</h3>\r\n\r\n<p>We share your Personal Information with third parties to help us use your Personal Information, as described above. For example, we use WordPress to power our online store&ndash;you can read more about how WordPress uses your Personal Information here: https://automattic.com/privacy/ We also use Google Analytics to help us understand how our customers use the Site&ndash;you can read more about how Google uses your Personal Information. You can also opt-out of Google Analytics :&nbsp;</p>\r\n\r\n<p>Finally, we may also share your Personal Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful requests for information we receive, or to otherwise protect our rights.</p>\r\n\r\n<h3>DO NOT TRACK</h3>\r\n\r\n<p>Please note that we do not alter our Site&rsquo;s data collection and use practices when we see a Do Not Track signal from your browser.</p>\r\n\r\n<h3>YOUR RIGHTS</h3>\r\n\r\n<p>If you are a European resident, you have the right to access personal information we hold about you and to ask that your personal information be corrected, updated, or deleted. If you would like to exercise this right, please contact us through the contact information below.</p>\r\n\r\n<p>Additionally, if you are a European resident we note that we are processing your information in order to fulfill contracts we might have with you (for example if you make an order through the Site), or otherwise to pursue our legitimate business interests listed above. Additionally, please note that your information will be transferred outside of Europe, including to Canada and the United States.</p>\r\n\r\n<h3>DATA RETENTION &amp; CHANGES</h3>\r\n\r\n<p>When you place an order through the Site, we will maintain your Order Information for our records unless and until you ask us to delete this information. We may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal or regulatory reasons.</p>\r\n\r\n<p>&nbsp;</p>',NULL,'2022-02-09 01:25:28'),
